import React from 'react';

const Rule = ({data}) => {
    return (
        <div className="cont_rule">
            <div className="cont_rule_zag">{data[0]}
            </div>
            <div className="cont_rule_text"> {data[1]}
            </div>
        </div>
    );
};

export default Rule;
